import React, { Component } from 'react';
import Helmet from 'react-helmet';
import { Link } from 'react-router-dom';

import './IndexTodo.css';

export default class IndexTodo extends Component {
  render() {
    return (
      <div className = "todo">
          <div className = "todo__title">
              <h2 className = "todo__content__title" >The Tutor Web</h2>
          </div>
          <div className = "todo__text">
              <p className = "about__content__text">The Smileycoin works just like other electronic currencies such as
              Bitcoin, Litecoin or Dogecoin.
              It was introduced as a reward to be used in an on-line educational system.
              </p>
          </div>
      </div>
    );
  }
}
